import React from 'react';
import FeatureImg from './component/feature-img/FeatureImg'
import Editor from './component/editor/Editor'

import './App.css';

function App() {
  return (
    <div className="App">
    <div className="container">
      <div className="row">
        <div className="col-md-6">
          <Editor />
        </div>
        <div className="col-md-6">
          <FeatureImg />
        </div>
      </div>
    </div>



    </div>
  );
}

export default App;
